import React from "react";

const Contato = () => {
  return (
    <section className="container contato">
      <h2 className="titulo">Contato</h2>
      <p className="subtitulo">Envie sua mensagem</p>
      <form>
        <div className="nome">
          <input type="text" />
        </div>
      </form>
    </section>
  );
};

export default Contato;
